import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ShowTodo  from './components/showTodo';
import CreateTodo from './components/createTodo';
import './App.css';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/">
            <ShowTodo />
          </Route>
          <Route path="/create-todo" component={CreateTodo} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
